textOriginal:
Além do crime lisura com os vulneráveis através da antecipação do auxílio comercial temos no projeto Guedes: trocar aposentadoria por plano de capitalização;
-eliminar a exigência da porcentagem do orçamento para saúde em troca de voucher para pagar clínicas particulares (deve ser por isso que o senhor Prata, patrono do HC, apelou contra esse governo dos ricos); -eliminar de vez a já sucateada pesquisas nas universidades federais e jamais haverá aumento real do salário mínimo  
Um desafio é colocado à mesa: identifique um único projeto de Guedes para diminuir a desigualdade social e eu voto com vcs família é grupos diversos
